                <div>
                    <label htmlFor='Name'>Name</label>
                <input type="text" name="name" value={name} onChange={(e)=>{setName(e.target.value)}}id="name"></input>
                </div>

                <div>
                    <label htmlFor='password'>password</label>
                <input type="text" name="email" value={password}onChange={(e)=>{setPassword(e.target.value)}} id="pass"></input>
                </div>

                <div>
                    <label htmlFor='passwprd'> confirm password</label>
                <input type="password" name="passw" value={password} onChange={(e)=>{setPassword(e.target.value)}} id="passw"></input>
                </div>



                <button  
                type="submit" id='send' >

                Register</button>

            </form>

        </>
    </div>
  )
}

export default Form
